    "data": {},
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render"
    },
    "props": {
        "action": {
            "type": "action"
        },
        "button-type": {
            "type": "string"
        },
        "default": {
            "type": "string"
        },
        "size": {
            "type": "string"
        }
    },
    "_viewModelId": "AwButton",
    "_uniqueViewModelId": "AwButton",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awButtonRenderFunction, undefined, ctxImportObj );

export default Component;
